# 给你一个二维整数数组 envelopes ，其中 envelopes[i] = [wi, hi] ，表示第 i 个信封的宽度和高度。
#
# 当另一个信封的宽度和高度都比这个信封大的时候，这个信封就可以放进另一个信封里，如同俄罗斯套娃一样。
#
# 请计算 最多能有多少个 信封能组成一组“俄罗斯套娃”信封（即可以把一个信封放到另一个信封里面）。
#
# 注意：不允许旋转信封。
#
#  
# 示例 1：
#
# 输入：envelopes = [[5,4],[6,4],[6,7],[2,3]]
# 输出：3
# 解释：最多信封的个数为 3, 组合为: [2,3] => [5,4] => [6,7]。
# 示例 2：
#
# 输入：envelopes = [[1,1],[1,1],[1,1]]
# 输出：1
#  
#
# 提示：
#
# 1 <= envelopes.length <= 5000
# envelopes[i].length == 2
# 1 <= wi, hi <= 104



from typing import List
from functools import lru_cache
import time
import bisect

class Solution:
    def maxEnvelopes1(self, envelopes: List[List[int]]) -> int:
        N = len(envelopes)
        def build():   # 构造有向图，从小的节点指向大的节点
            graph = [[] for _ in range(N)]
            for i in range(N):
                for j in range(i + 1, N):
                    if envelopes[i][0] < envelopes[j][0] and envelopes[i][1] < envelopes[j][1]:
                        graph[i].append(j)
                    elif envelopes[i][0] > envelopes[j][0] and envelopes[i][1] > envelopes[j][1]:
                        graph[j].append(i)
            return graph

        length = {}
        def get(idx):
            if idx in length:
                return length[idx]
            res = 0
            for e in graph[idx]:
                res = max(res, get(e))
            length[idx] = res + 1
            return res + 1

        start = time.time()
        graph = build()
        # print(graph)
        now = time.time()
        print(now - start)
        res = 0
        for i in range(N):
            res = max(res, get(i))
        print(time.time() - now)
        return res


    def maxEnvelopes(self, envelopes: List[List[int]]) -> int:
        M = 10000    # 桶排序，桶的个数
        barrels = [[] for _ in range(M)]
        start = time.time()
        for e in envelopes:
            bisect.insort(barrels[e[0]], e[1])

        new = []  # 按 w 的升序，如果有相同的w ，按h的降序排列
        for w, e in enumerate(barrels):
            if len(e) == 0:
                continue
            for h in e[::-1]:
                new.append(h)
        print(new)

        now = time.time()
        print(now - start)

        # 对 h 使用 LIS
        def LIS(seq):
            number = len(seq)
            if number == 0:
                return 0
            A = [0] * number
            A[0] = 1
            # A[i] 表示以 seq[i]结尾的最大字序长度
            for i in range(1, number):
                if seq[i] == seq[i - 1]:
                    A[i] = A[i - 1]
                else:
                    max_v = 1
                    for j in range(i):
                        # print(max_v, i, j)
                        if seq[i] > seq[j]:
                            max_v = max(max_v, A[j] + 1)
                    A[i] = max_v
            return max(A)

        ret = LIS(new)

        return ret



so = Solution()
